import Button from 'react-bootstrap/Button'
import UserInformationSection from '../Profile/UserInformationSection'
import GenderAndOrientation from '../Profile/GenderAndOrientation'
import TagsBadge from '../MemberProfile/TagsBadge';
import PasswordChangeSection from '../Profile/PasswordChangeSection'
import Location from '../Profile/Location'
import AlertMsg from '../AlertMsg/AlertMsg';
import ConfirmWindow from '../ConfirmWindow/ConfirmWindow';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import { v4 as uuidv4 } from 'uuid';
import { NAMES_REGEX, USERNAME_REGEX, EMAIL_REGEX, PASSWORD_REGEX } from '../../other/Regex';
import { AiFillWarning } from 'react-icons/ai';
import { RiErrorWarningLine } from 'react-icons/ri';
import { CgCloseO } from 'react-icons/cg';
import { BsShieldLockFill } from 'react-icons/bs';
import { TiLocation } from 'react-icons/ti';
import { IoPinSharp } from 'react-icons/io5';





const CompleteProfile = () => {

    useEffect( () => {
        document.title = 'Compléter pro - Matcha'
    }, [])

    return (
        <Fragment>
            <header>
                <Alert variant='warning' className='complete-profile-alert'>
                    <AiFillWarning className='mr-2' />
                    Veuillez compléter votre profil afin d'accéder aux autres services
                </Alert>
            </header>
        </Fragment>

    )
}

export default CompleteProfile
